Простой способ, применяемый в основном для квартир. 
Учет теплопотерь сводится к усредненным значениям.  
Данный способ рационально если:
- внешние стены не утеплены;
- в квартире имеются не более 4 стандартных окна;
- радиаторы подключены наиболее эффективным способом;
- соседние квартиры отапливаются.
